import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <button className="login-btn">Login</button>
      </header>
      <div className="btn-container">
        <button className="btn">
          <img src="editor-logo.png" alt="Code Editor Logo" />
          <div>Code Editor</div>
        </button>
        <button className="btn">
          <img src="portfolio-logo.png" alt="Portfolio Logo" />
          <div>Portfolio</div>
        </button>
        <button className="btn">
          <img src="strategy-logo.png" alt="Strategy Management Logo" />
          <div>Strategy Management</div>
        </button>
      </div>
    </div>
  );
}

export default App;
